import React from "react";
import Box from '@mui/material//Box';
import Grid from '@mui/material/Grid';




const Login = () => {
    return (
        <Box mt={10}>
        <Grid container>
            <Grid item xs={12} textAlign='center'>
                <div className="login__header">
                    <h1>Welcome !!</h1>
                </div>
            </Grid>
        </Grid>
        </Box>
    );
}

export default Login;
